import pandas as pd

def create_student_dataframe(students):
    """"""
    df = pd.DataFrame(students)
    df = df[(df['Age'] >= 16) & (df['Age'] <= 20) & (df['Grade Level'] >= 9) & (df['Grade Level'] <= 13) & (df['Favorite Subject'].str.len() >= 5) & (df['Favorite Subject'].str.len() <= 30)]
    return df.sort_values(by='Age', ascending=True)
